    refuge accomplishments from 1 October- 31 December 1942.  It begins with a monthly
    account of distribution of enrolled CCC personnel.  It includes updates of engineering
    and land management projects conducting during the quarter, such as: surveys, site
    clearing, levee dyke and jettie construction, builidng construction, seeding projects,
    signage installation and wildfire prevention measures.  This report also includes
